import React from 'react';

const Card = (props) => {
	return(
		<div className="bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5 tc">
			<img alt="{props.character}" src="hi"/>
			<div>
				<h2>{props.character}</h2>
				<p>{props.reading}</p>
				<p>{props.meaning}</p>
			</div>
		</div>

	);
}

export default Card;
